Actual Solution:
Rotating $360^\circ$ is the same as doing nothing, so rotating $600^\circ$ is the same as rotating $600^\circ - 360^\circ = 240^\circ$.  Therefore, we have $\sin 600^\circ = \sin (600^\circ - 360^\circ) = \sin 240^\circ$.

Let $P$ be the point on the unit circle that is $240^\circ$ counterclockwise from $(1,0)$, and let $D$ be the foot of the altitude from $P$ to the $x$-axis, as shown below.

[asy]
pair A,C,P,O,D;
draw((0,-1.2)--(0,1.2),p=black+1.2bp,Arrows(0.15cm));
draw((-1.2,0)--(1.2,0),p=black+1.2bp,Arrows(0.15cm));
A = (1,0);
O= (0,0);
label("$x$",(1.2,0),SE);
label("$y$",(0,1.2),NE);

P = rotate(240)*A;
D = foot(P,A,-A);
draw(O--P--D);
draw(rightanglemark(O,D,P,2));
draw(Circle(O,1));
label("$O$",O,SE);
label("$P$",P,SW);
//label("$A$",A,SE);
label("$D$",D,N);
[/asy]

Triangle $POD$ is a 30-60-90 triangle, so $DO = \frac{1}{2}$ and $DP = \frac{\sqrt{3}}{2}$.  Therefore, the coordinates of $P$ are $\left(-\frac12,-\frac{\sqrt{3}}{2}\right)$, so $\sin 600^\circ = \sin240^\circ = \boxed{-\frac{\sqrt{3}}{2}}$.

There are 36 possible outcomes for the two dice. Of these, there is 1 where both dice roll a six, 5 where the first die rolls a six and the other rolls something less than a six, and 5 more where the second die rolls a six and the first die rolls something less than a six. So, there are a total of $1+5+5=11$ ways the larger number rolled can be a six. Similarly, there are $1+4+4=9$ ways the larger number rolled can be a five, $1+3+3=7$ ways the larger number rolled can be a four, $1+2+2=5$ ways the larger number rolled can be a three, $1+1+1=3$ ways the larger number rolled can be a two, and $1$ way the larger number rolled can be a one. The expected value of the larger number is \begin{align*}
\frac{1}{36}(11(6)+9(5)&+7(4)+5(3)+3(2)+1(1))\\
&=\frac{1}{36}(66+45+28+15+6+1)\\
&=\boxed{\frac{161}{36}}
\end{align*}

