draw(surface(a--b--c--cycle),pink,nolight);
draw(b--c--d--b);
draw(c--a--b,dashed); draw(a--d--p--b,dashed);
draw(p+(d-p)*0.08--p+(d-p)*0.08+(b-p)*sqrt(2)*0.08--p+(b-p)*sqrt(2)*0.08);
